import React from 'react'

const Card = ({ comment }) => {
    return (
        <div className="card mb-3">
            <div className="card-body">
                <h5 className="card-title">{comment.name}</h5>
                <p className="card-text">{comment.content}</p>
                <a href="#" class="card-link">Ответить</a>
            </div>
        </div>
    )
}

export default Card;
